import React, { Component } from 'react';
import './universityCard';

function UniversityCard(props) {
    console.log(props);
    const {university}= props;
    return (

          <div className="schools">

            <div className="school-name" style={{ fontSize: "30px", color: "rgb(37, 15, 161)" }}><strong>{university["name"]}</strong></div>
            <div><strong>{university["country"]}</strong></div>
            <div>Domain: {university["domains"]} </div>
            <div>Website: <a href={[university["web_pages"]]} >{[...props.university["web_pages"]]}</a></div>
            {/* <div><input className="Add-school" type="button" onClick={() => { clicked(); props.update(school) }} value={addBtnTxt} /></div> */}
          </div>
      )

}
export default UniversityCard;
